import * as React from "react"
import { useWindowDimensions } from 'react-native';
import Svg, { Circle } from "react-native-svg"

const SettingsSvg = (props) => {
  const { width, height } = useWindowDimensions();
  const circleSize = Math.min(width * 0.01, height * 0.01);

  return (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      width={circleSize}
      height={circleSize * 4}
      fill="none"
      {...props}
    >
      <Circle cx={circleSize / 2} cy={circleSize / 2} r={circleSize / 2} fill="#373535" />
      <Circle cx={circleSize / 2} cy={circleSize / 2 + circleSize * 3} r={circleSize / 2} fill="#373535" />
      <Circle cx={circleSize / 2} cy={circleSize / 2 + circleSize * 2} r={circleSize / 2} fill="#373535" />
    </Svg>
  );
}

export default SettingsSvg;
